import { Document, Page } from 'react-pdf';

const options = {
    cMapUrl: 'cmaps/',
    cMapPacked: true,
    standardFontDataUrl: 'standard_fonts/',
  };

const Resume = () => {
    return (
        <div>
            <Document file="AdamNelson_Resume2022.pdf" options={options}>
                <Page />
            </Document>

        </div>
    );
};

export default Resume;
